import React from "react";
import "../Styles/header2.css";

class MainSkeleton extends React.Component {
  render() {
    return (
      <div class="topnav">
        - var myList = ['Home', 'About', 'Services', 'Team', 'Portifilio',
        'Content'] ul each val in myList li a(href='#')= val
      </div>
    );
  }
}

export default MainSkeleton;
